import APIHandler from "./APIHandler.js";

class APIPackage extends APIHandler {
  

  async queryAllPackages() {
    try {
      const data = await this.getRequest(
        "http://54.146.196.79:8080/dp1/api/package/all" 
      );
      return data;
    } catch (error) {
      console.error(error);
    }
  }

  

}

export default APIPackage;
